INSERT INTO productos (nombre, marca, descrip, talla, imagen, precio, stock, eliminado) VALUES
    ('Air Jordan 1 Retro High OG ''Shadow'' 2018', 'Nike', 'Este Air Jordan 1 Retro High OG ''Shadow'' 2018 es una reedición retro de una combinación de colores original de 1985. El zapato presenta una parte superior de cuero negra y gris medio con una entresuela blanca y suela exterior negra. También presenta el logotipo OG de Nike Air en la lengüeta y el logotipo de Wings en el cuello del tobillo. Se volvió a lanzar por última vez en 2013, y una versión de baja altura se lanzó en 2015.', 42, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707846984/sroghljsuru08jllahcn.png', 250.00, 2,0),
    ('Air Jordan 4 Retro OG GS ''Bred'' 2019', 'Nike', 'Este Air Jordan 4 Retro OG GS ''Bred'' 2019 es una reedición retro de una combinación de colores original de 1989. El zapato presenta una parte superior de cuero negro con acentos rojos y grises. También presenta la marca Nike Air en el talón y la suela exterior con patrón de espina de pescado. Se lanzó por última vez en 2019.', 40, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707847036/kvlo2mhddbpddsh0v0in.png', 220.00, 3,0),
    ('Air Jordan 11 Retro ''Space Jam'' 2016', 'Nike', 'Este Air Jordan 11 Retro ''Space Jam'' 2016 es una reedición retro de una combinación de colores original de 1996. El zapato presenta una parte superior de cuero negro con acentos de charol negro y detalles de color azul real. También presenta la marca Jumpman en la lengüeta y el talón. Se lanzó por última vez en 2016.', 41, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707847100/h4soytle9wpgbjxsnhfd.png', 300.00, 1,0),
    ('Air Jordan 11 Retro ''Win Like ''96''', 'Nike', 'Este Air Jordan 11 Retro ''Win Like ''96'' es una reedición retro de una combinación de colores inspirada en los colores de los Chicago Bulls. El zapato presenta una parte superior de cuero rojo con detalles negros y blancos. También presenta la marca Jumpman en la lengüeta y el talón. Se lanzó por última vez en 2017.', 43, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707847154/q5r8zzaozdbmhfxcpbp9.png', 320.00, 2,0);
INSERT INTO productos (nombre, marca, descrip, talla, imagen, precio, stock,eliminado) VALUES
