    ('Wmns Air Jordan 12 Retro ''Reptile''', 'Nike', 'Este Wmns Air Jordan 12 Retro ''Reptile'' presenta una parte superior de cuero blanco con detalles de piel de serpiente en relieve en el panel lateral y en la puntera. También presenta la marca Jumpman en la lengüeta y el talón.', 41, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707847310/lt8xofoiu5al8vczxpzp.png', 210.00, 3,0),
    ('Air Jordan 4 Retro ''Laser''', 'Nike', 'Este Air Jordan 4 Retro ''Laser'' presenta una parte superior de cuero blanco con grabados láser en todo el zapato. También presenta acentos plateados y la marca Jumpman en la lengüeta, el talón y la suela exterior.', 43, 'https://res.cloudinary.com/dahrrd7yj/image/upload/v1707847364/z17qv055jfqml2zgrmex.png', 250.00, 1,0);
